import { useState } from "react";
import axios from "../axiosURL";
import { useNavigate } from "react-router-dom";

const Account = () => {
    const navigate = useNavigate();

    const [email, setEmail] = useState("")
    const [password, setPassword] = useState("")

    // login function which a makes a axios post request to "/login"
    const onLogin = () => {
        axios.post("/login", {email, password}, {withCredentials: true})
        .then((res) => {
            console.log(res)
            navigate("/")
        }).catch((err) => {
            console.log(err)
        })
    }

    // on change for email
    const onChangeEmail = (e) => {
        setEmail(e.target.value)
    }

    const onChangePassword = (e) => {
        setPassword(e.target.value)
    }

    // on change for password

    return(
        <div className="Account__Container">
            <h2>Login</h2>
            <div>
                <label>E-Mail</label>
                <input type="text" value={email} onChange={onChangeEmail}></input>
            </div>
            <div>
                <label>Passwort</label>
                <input type="text" value={password} onChange={onChangePassword}></input>
            </div>
            <div>
                <button onClick={onLogin}>Login</button>
            </div>
        </div>
    )
}

export default Account;
